import './App.css';
import React from 'react'
import {Routes, Route} from "react-router-dom"
import Home from "./Home/Home"
import Logement from './logement/Logement';
import APropos from './APropos/APropos';
import Notfound from './notfound/Notfound';
import AProposOpen from './AproposOpen/AproposOpen';
import ComposantsDesktop from './ComposantsDesktop/ComposantsDesktop';

function App() {
  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/*" element={<Notfound/>}/>
        <Route path="/logement" element={<Logement/>}/>
        <Route path="/ComposantsDesktop" element= {<ComposantsDesktop/>}></Route>
        <Route path="/APropos" element={<APropos/>}/>
        <Route path="/AproposOpen" element={<AProposOpen/>}/>
      </Routes>

    </div>
  );
}
export default App;
